import React from 'react';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

function SignIn() {
  const [userEmail, setUserEmail] = React.useState('');
  const [userPassword, setUserPassowrd] = React.useState('');
  return (
    <div>
      <Container
        style={{ border: '1px solid #41A58D', marginTop: 150, width: '50%' }}
        maxWidth='md'
      >
        <div style={{ padding: 40 }}>
          <Grid xs={12}>
            <Typography style={{ fontSize: 25, fontWeight: 500 }}>
              Izze admin Pannel
            </Typography>
            <div>
              <Typography
                style={{ marginTop: 10, fontSize: 20, fontWeight: 500 }}
              >
                Login Here
              </Typography>
              <TextField
                style={{ marginTop: 20, width: '70%' }}
                id='outlined-basic'
                label='Enter Email'
                variant='outlined'
                value={userEmail}
                onChange={(e) => setUserEmail(e.target.value)}
              />
            </div>
            <div>
              <TextField
                style={{ marginTop: 20, width: '70%' }}
                id='outlined-basic'
                type='password'
                label='Enter Password'
                variant='outlined'
                value={userPassword}
                onChange={(e) => setUserPassowrd(e.target.value)}
              />
            </div>
            <div style={{ marginTop: 40 }}>
              <Button
                style={{
                  backgroundColor: '#41A58D',
                  color: 'white',
                  textTransform: 'capitalize',
                  width: '30%',
                }}
              >
                Login Here
              </Button>
            </div>
          </Grid>
        </div>
      </Container>
    </div>
  );
}

export default SignIn;
